import notifi from "./asserts/notification.png";
import notifi2 from "./asserts/notification2.png";
import chat from "./asserts/chat.png";

export const notification = [
    {
        id: 1,
        img: notifi,
        msg: "you have a new session to re..",
        time: "Today, 12:00PM",
    },
    {
        id: 2,
        img: notifi2,
        msg: "you have a virtual session..",
        time: "Yesterday, 3:00PM",
    },
    {
        id: 3,
        img: chat,
        msg: "you have a face to face stat....",
        time: "Yesterday, 4:00PM",
    },
];
